  <Btn name={'Tournament'} href={''} img={''} current={''} />,
  <Btn name={'Connect'} href={''} img={''} current={''} />,
  <Btn name={'Profile'} href={''} img={''} current={''} />,
]

export default function Header() {
  return (
    <div className="Header-Child">
      { 
